import { Unidade } from "../types/Unidade";

export const mapUnidade = (unidades: Unidade[]) => {
    return unidades.map(u => ({...u, codigoUnidade: u?.codigoUnidade?.split("/")?.findLast(_ => true) ?? ''}))
}
